members.comment:
 同期イベントクラス

 Windowsの CreateEvent や SetEvent のラッパー
 Windows以外の環境でも動作するが、最適な実装ではないかもしれない。
 Example:
------------------------------------------------------------------------------
SyncEvent[3] ev;
int data;
void run1()
{
	data = 1;
	ev[0].signal = true;
}

void run2()
{
	data = 2;
	ev[1].signal = true;
}

void run3()
{
	data = 3;
	ev[2].signal = true;
}
void main()
{
	ev[] = [new Light, new Light, new Light];
	scope t = new ThreadGroup;
	data = 0;
	t.create(&run1);
	ev[0].wait;
	assert(data == 1);
	data = 0;
	t.create(&run2);
	ev[1].wait;
	assert(data == 2);
	data = 0;
	t.create(&run3);
	ev[2].wait;
	assert(data == 3);
}
------------------------------------------------------------------------------
